pragma solidity >=0.4.25 <0.9.0;

contract HealthCare {
    address private owner;

    // enum Level {
    //     High,
    //     Healthy,
    //     Low
    // }

    // enum Role {
    //     Owner,
    //     Admin,
    //     Doctor,
    //     Patient
    // }

    struct Hospital {
        address id;
        string name;
        string email;
        uint phone;
        string description;
        string location;
    }

    struct Doctor {
        address id;
        string name;
        string email;
        uint phone;
        string type_name;
        string location;
        address hospital;
    }

    struct Patient {
        address id;
        string name;
        uint phone;
        string email;
        // uint score;
        // Analysis[] history;
    }

    struct Analysis {
        uint256 ID;
        string testName;
        address hospital;
        address doctor;
        uint256 price;
        string date;
        uint256 value;
        uint256 min;
        uint256 max;
        uint256 weight;
        uint256 signatureCount;
        mapping(address => uint256) signatures;
    }

    mapping(address => Hospital) private hospitals;
    mapping(address => Doctor) private doctors;
    mapping(address => Patient) private patients;
    mapping(address => Analysis[]) reports;

    constructor() {
        owner = msg.sender;
    }

    modifier checkDoctor() {
        Doctor memory d = doctors[msg.sender];
        require(d.id > address(0x0), "Access Denied");
        _;
    }

    modifier checkPatient() {
        Patient storage p = patients[msg.sender];
        require(p.id > address(0x0), "Access Denied");
        _;
    }

    modifier checkAdmin() {
        Hospital storage h = hospitals[msg.sender];
        require(h.id > address(0x0), "Access Denied");
        _;
    }

    modifier checkDoctorOrHospital() {
        Hospital memory h = hospitals[msg.sender];
        Doctor memory d = doctors[msg.sender];
        require(h.id > address(0x0) || d.id > address(0x0), "Access Denied");
        _;
    }

    event Signup(address add, string name, string role);

    function addDoctor(
        string memory _name,
        string memory email,
        uint phone,
        string memory _type_name,
        string memory _location
    ) public {
        Doctor memory d = doctors[msg.sender];
        require(keccak256(abi.encodePacked(_name)) != keccak256(""), "");
        require(!(d.id > address(0x0)), "Account already present");
        doctors[msg.sender] = Doctor({
            id: msg.sender,
            name: _name,
            email: email,
            phone: phone,
            type_name: _type_name,
            location: _location,
            hospital: address(0x0)
        });
        emit Signup(msg.sender, _name, "Doctor");
    }

    function addPatient(
        string memory _name,
        uint _phone,
        string memory _email
    ) public {
        Patient storage p = patients[msg.sender];
        require(keccak256(abi.encodePacked(_name)) != keccak256(""), "");
        require(!(p.id > address(0x0)), "Account already present");
        patients[msg.sender] = Patient(msg.sender, _name, _phone, _email);
        emit Signup(msg.sender, _name, "Patient");
    }

    function addHospital(
        string memory name,
        string memory descr,
        string memory location,
        uint _phone,
        string memory _email
    ) public {
        Hospital memory h = hospitals[msg.sender];
        require(keccak256(abi.encodePacked(name)) != keccak256(""), "");
        require(!(h.id > address(0x0)), "Account already present");
        hospitals[msg.sender] = Hospital(
            msg.sender,
            name,
            _email,
            _phone,
            descr,
            location
        );
        emit Signup(msg.sender, name, "Hospital");
    }

    function Login()
        public
        view
        returns (address id, string memory name, string memory email)
    {
        Patient memory p = patients[msg.sender];
        Hospital memory h = hospitals[msg.sender];
        Doctor memory d = doctors[msg.sender];
        if (p.id > address(0x0)) {
            return (msg.sender, p.name, p.email);
        } else if (h.id > address(0x0)) {
            return (msg.sender, h.name, h.email);
        } else if (d.id > (address(0x0))) {
            return (msg.sender, d.name, d.email);
        }
        return (address(0x0), "", "");
    }

    function getPatientInfo(
        address pAddress
    )
        public
        view
        checkDoctorOrHospital
        returns (string memory name, string memory email, uint phone)
    {
        Patient memory p = patients[pAddress];
        require((p.id > address(0x0)), "Patient Not Found");
        return (p.name, p.email, p.phone);
    }

    function getDoctorProfile(
        address dAddress
    )
        public
        view
        returns (
            string memory name,
            string memory email,
            uint phone,
            address hospital
        )
    {
        Doctor memory d = doctors[dAddress];
        require((d.id > address(0x0)), "Doctor Not Found");
        return (d.name, d.email, d.phone, d.hospital);
    }
}

